import backgroundImage from "./images/background.png";
import './App.css';

function App() {
  return (
    <div className="App">
      <img src={backgroundImage} className="backgroundImage">
        <div className="appBGOverlay">
        </div>
      </img>
    </div>
  );
}

export default App;
